import{_ as d,n as o,p as a,q as c,s as i,R as e,t as l,Z as t}from"./framework-fdd38eac.js";const n="/assets/1563280969887-ce47c760.png",r="/assets/1563279932213-30a18cbd.png",g="/assets/1563283651783-863aa56f.png",A="/assets/1563283740154-6b58ea93.png",p="/assets/1563283891212-e0d35911.png",h="/assets/1563287649285-bd5691de.png",m="/assets/1563286232922-fc82d20e.png",u="/assets/1563286261260-090cfa4e.png",v="/assets/1563286834821-6cd8a4c5.png",b="/assets/1563286901606-25b8ec5a.png",f="data:image/png;base64,",x="/assets/1563785015671-d6ef5b52.png",E="/assets/1563785696463-5778ce66.png",C="/assets/1563585356493-4052abe8.png",I="/assets/1563575930059-e5eb89cb.png",Q="/assets/1563884390124-2450d3f9.png",_="/assets/1563577915957-02aa9fa2.png",H="/assets/1563578098463-f2e2ee85.png",B="/assets/1563580891081-be5a7167.png",R="/assets/1563585430865-01b53f95.png",y="/assets/1563584514880-75f9d742.png",G="/assets/1563584711271-0c388a4b.png",k="/assets/1563691729243-8c14d93b.png",D="/assets/1563684239949-6bb47c0d.png",$="/assets/0-22a82fd0.png",K="/assets/1563836194206-dcd2314e.png",N="/assets/0-1563836371999-da31409b.png",P="/assets/1563836930039-e5579efa.png",F="/assets/1563702103067-6f1152ac.png",S="/assets/1563891878689-986be734.png",U="/assets/1563892813240-80341493.png",z="/assets/1563892791687-618e317a.png",L="/assets/1563893664907-905bf33d.png",w="/assets/1563892659893-46c60571.png",V="/assets/1566879129657-a79b7893.png",O={},X=t('<h1 id="git" tabindex="-1"><a class="header-anchor" href="#git" aria-hidden="true">#</a> git</h1><h2 id="集中式对比分布式" tabindex="-1"><a class="header-anchor" href="#集中式对比分布式" aria-hidden="true">#</a> 集中式对比分布式</h2><p>git：分布式版本控制系统</p><p>版本控制系统：开发中我们把每一次的修改都有效的进行记录（记录成一个版本），后期如果需要回退到原有的某个版本或者是用当前的和某一个版本进行比较等，都可以有效的进行管理。 常用的版本控制系统：SVN（集中式） / git（分布式）</p><ul><li><p>分布式版本管理系统的特点 所谓分布式，就是每一个开发者的本地客户端都是一个完整的仓库，都能记录历史版本信息，这样不需要联网，我们也能生成历史版本记录，也可以快速回退到某个版本 单人开发：根本不需要中央服务器，不需要联网，在自己的电脑上就可以保留历史版本。 多人开发：如果没有中央服务器，只是不能团队协作，但是可以生成历史版本 <img src="'+n+'" alt="1563280969887"></p></li><li><p>集中式版本管理系统的特点 所有的历史版本都是再中央服务器上建立的，本地客户端只是一个开发的环境，开发完需要推到服务器上生成历史版本，需要回退到某个版本，也需要从中央服务器拉取。=&gt;“必须连接上中央服务器才可以” <strong>必须联网</strong></p><p>不论是单人开发还是多人开发，都不能脱离中央服务器。 限制情景：例如上传到中央服务器上，自己出差在飞机上，老板说代码有问题需要改，但是自己电脑上的代码是最新版，不是上一个版本，没有办法回退到上一个版本，必须联网（哪怕是局域网）回退到上一个版本才可以继续工作，限制了工作的继续。</p><p><img src="'+r+`" alt="1563279932213"></p></li><li><p>git和SVN的区别 <strong>本质区别</strong>：git有本地仓库，是可以保留历史版本的，有中央服务器可以协作开发。而SVN只有中央服务器，中央服务器必须联网才能推送历史记录，并且进行协作开发。 git是按照源数据（文件流）来实现文件传输的，而SVN是按照文件传输的，所以git比SVN传输速度更快。</p></li><li><p>Linux团队开发的git，所以git中的命令大部分都是linux命令</p></li></ul><h2 id="常用的linux命令" tabindex="-1"><a class="header-anchor" href="#常用的linux命令" aria-hidden="true">#</a> 常用的LINUX命令</h2><p>WINDOWS操作系统：DOS窗口和DOS命令</p><p>LINUX服务器操作系统：LINUX命令（MAC）</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>ls -l/-a：查看当前目录结构（-a是可以看见所有的：包含隐藏的）
cd xxx[路径地址]：进入到执行的文件夹中（进入的路径地址，可以粘贴或者拖文件）
	cd /：根目录
	cd ./：当前目录
	cd ../：上级目录
clear：清屏
mkdir：创建文件夹
touch：创建空的文件
vi：向文件中插入或者管理一些内容
	i：进入到插入模式
	ESC + :WQ  退出内容的插入，把刚才编辑的内容进行保存
echo xxx &gt; xxx.txt 或者 echo xxx &gt;&gt; xxx.txt：向指定的文件中输入内容，把前面的内容插入到后面的文件中（覆盖性），如果没有这个文件会创建文件写入内容
cat：查看文件中的内容
cp：拷贝
rm：删除文件 -r（递归删除）-f（强制删除，一旦删除无法还原）-rf（既有递归又有强制删除）
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p><img src="`+g+'" alt="1563283651783"></p><p><img src="'+A+'" alt="1563283740154"></p><p><img src="'+p+'" alt="1563283891212"></p><h2 id="基础工作流程" tabindex="-1"><a class="header-anchor" href="#基础工作流程" aria-hidden="true">#</a> 基础工作流程</h2><p>git的常规流程：</p><ul><li><p>每一个git仓库都有三个区</p><ul><li>工作区：写代码 <code>$git add -A/.</code>把当前工作区修改的内容全部提交到暂存区（可以指定具体提交的文件<code>$git add xxx.js</code>）</li><li>暂存区：临时存放每一次修改的代码，但是并没有生成历史版本 <code>$git commit -m[备注]</code>把暂存区的内容提交到历史区，生成一个历史版本（我们需要写备注信息，声明当前版本的特点）</li><li>历史区：生成最终版，有版本号</li></ul><p><img src="'+h+'" alt="1563287649285"></p></li><li><p>创建git仓库：<code>$git init</code></p></li><li><p>每一次区域间信息的提交都不会删除原有区域的内容，这样保证，下一次提交，只是把区域对比出来不一样的内容提交，而不是所有。</p></li><li><p><code>$git status</code>：查看当前修改的文件处于哪一个区域。红色：工作区；绿色：暂存区；看不见：已经提交到历史区，三区保持一致了</p></li><li><p><code>$git rm --cached xxx.xx</code>：把暂存区的某一个文件删除（提交到暂存区的内容不好，我们可以删除）</p></li><li><p><code>$git rm --cached . -r</code>：删除暂存区中所有提交的</p></li></ul><p><img src="'+m+'" alt="1563286232922"></p><p><code>.git</code>文件夹是关键，里面存放暂存区和历史区的文件</p><p><img src="'+u+'" alt="1563286261260"></p><ul><li><code>$git checkout xxx.xx</code><strong>场景</strong>：提交到暂存区一份，把工作区内容改了，但是改的东西不好，想把暂存区上次提交的内容撤回到工作区（覆盖工作区新写的内容） 暂存区内容没有消失，只是把工作区最新修改的信息给覆盖了，让工作区和暂存区保持一致</li></ul><p><img src="'+v+'" alt="1563286834821"></p><p><img src="'+b+`" alt="1563286901606"></p><ul><li><code>$git diff</code>：工作区vs暂存区代码区别</li><li><code>$git diff master</code>：工作区vs历史区master分支代码区别</li><li><code>$git diff --cached</code>：暂存区vs历史区代码区别</li></ul><h2 id="一些细节问题" tabindex="-1"><a class="header-anchor" href="#一些细节问题" aria-hidden="true">#</a> 一些细节问题</h2><ul><li><p>如果是第一次使用git，生成历史版本的时候，需要提供身份认证</p><ul><li><code>$git config l</code>：查看所有配置信息</li><li><code>$git config --global user.name &#39;xxx&#39;</code>：添加user.name</li><li><code>$git config --global user.email &#39;xxx&#39;</code>：添加user.email</li></ul></li><li><p>真实项目中，并不是所有的文件都和项目有关系（例如：.idea是webStorm生成的配置文件夹和项目没关系），也不是所有的文件都提交（例如：node_modules中的内容太大了，也不需要提交） <code>.gitignore</code>git提交的忽略文件</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code># dependencies
/node_modules

# testing
/coverage

# production
/build

# misc
.DS_Store
.env.local
.env.development.local
.env.test.local
.env.production.local

npm-debug.log*
yarn-debug.log*
yarn-error.log*

.idea
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></li><li><p><code>$git log</code>查看历史版本信息，如果信息太长，按Q结束</p></li></ul><h2 id="关于git的回滚" tabindex="-1"><a class="header-anchor" href="#关于git的回滚" aria-hidden="true">#</a> 关于git的回滚</h2><h3 id="暂存区回滚到工作区" tabindex="-1"><a class="header-anchor" href="#暂存区回滚到工作区" aria-hidden="true">#</a> 暂存区回滚到工作区</h3><ul><li><code>$git checkout -- [file]</code>：把暂存区上次提交的[file]文件回滚到工作区的[file]文件 有两种情况： 一种是[file]文件自修改后还没有放到暂存区，现在，撤销修改就回滚到暂存区上次提交的[file]文件； 一种是[file]文件已经添加到暂存区，又做了修改，现在，撤销修改就回滚到暂存区上次提交的[file]文件。 总之，就是让[file]文件回到最近一次<code>$git commit</code>和<code>$git add</code>时的状态。 命令中的<code>--</code>很重要，如果没有<code>--</code>，就变成了“切换到另一个分支”的命令。 <strong>场景</strong>：当你乱改了工作区某个文件的内容，想直接丢弃工作区的修改时。</li><li><code>$git checkout .</code>：把暂存区内容回滚到工作区（一旦回滚，工作区内容无法恢复）</li></ul><h3 id="暂存区回滚" tabindex="-1"><a class="header-anchor" href="#暂存区回滚" aria-hidden="true">#</a> 暂存区回滚</h3><ul><li><p><code>$git reset HEAD [file]</code>：可以把暂存区的修改撤销回滚到上一个暂存区 <code>$git reset</code>命令既可以回退版本，也可以把暂存区的修改回滚到上一个暂存区。当我们用<code>HEAD</code>时，表示最新的版本。 <strong>场景</strong>：当你不但改乱了工作区中[file]文件的内容，还添加到了暂存区，想丢弃修改，分两步，第一步用命令<code>$git reset HEAD [file]</code>回滚到上一个暂存区；此时就回到了上一个场景，<code>$git checkout -- [file]</code>命令再撤销工作区的修改。</p></li><li><p><code>$git reset HEAD .</code>：把当前暂存区的内容回滚到上一个暂存区，目的是把上一个暂存区内容回滚到工作区。</p></li></ul><p><strong>下图场景</strong>：（<strong>第一步可以不做</strong>：此时工作区已经变成1+100，想要回滚到1+1，先把工作区使用<code>$git checkout .</code>命令把工作区内容撤销到最近一次<code>$git commit</code>和<code>$git add</code>时的状态，）执行<code>$git reset HEAD .</code>命令把当前暂存区的内容1+10回滚到上一个暂存区的1+1；再执行<code>$git checkout .</code>，把当前暂存区的所有内容回滚到工作区，此时工作区的内容就撤销到了1+1。</p><p><img src="`+f+'" alt="1563289911026"></p><h3 id="历史区回滚到工作区和暂存区" tabindex="-1"><a class="header-anchor" href="#历史区回滚到工作区和暂存区" aria-hidden="true">#</a> 历史区回滚到工作区和暂存区</h3><ul><li><p><code>$git reset --hard HEAD^</code>：把上一个历史区回滚到暂存区和工作区（强制把暂存区和工作区都变成回滚后的版本） 在git中，用<code>HEAD</code>表示当前版本，上一个版本就是<code>HEAD^</code>，上上一个版本就是<code>HEAD^^</code>，往上100个版本写100个<code>^</code>容易数不过来，所以写成<code>HEAD~100</code><strong>场景</strong>：已经提交了不合适的修改到版本库时，就要用到该命令。不过前提是没有推送到远程库。</p></li><li><p><code>$git reset --hard [版本号]</code>：回退版本之后，之前最新的版本已经看不到了，但是如果知道那个版本号就可以指定版本号穿梭。 如果回退版本之前的窗口有<code>$git log</code>操作并且没关闭，可以看到版本号。 <code>$git reflog</code>记录了自己每一次的命令，知道了版本号之后，又可以乘坐时光机回到未来了。</p><p><img src="'+x+'" alt="1563785015671"> [版本号]版本号没必要写全，前几位就可以了，Git会自动去找。当然也不能只写前一两位，因为Git可能会找到多个版本号，就无法确定是哪一个了。</p></li><li><p><code>$history &gt; xxx.txt</code>把历史操作步骤输出</p></li></ul><h2 id="关于git的删除" tabindex="-1"><a class="header-anchor" href="#关于git的删除" aria-hidden="true">#</a> 关于git的删除</h2><p>在git中，删除也是一个修改操作，新建一个[file]文件，并且添加到暂存区和历史区。</p><p>把没用的[file]文件删除：直接在文件管理器删除或者用<code>rm [file]</code>命令删除。</p><p>此时，git知道删除了文件，<code>$git status</code>命令可以看到。</p><p>现在又两种情况：</p><ul><li>确实要从版本库中删除该文件，就用<code>$git rm [file]</code>删除掉，并且<code>$git commit</code>。现在，[file]文件就从版本库中删除了。</li><li>另一种情况是删错了，想要恢复，因为版本库中存在。 <ul><li>如果用的<code>rm</code>删除文件，可以直接使用<code>$git checkout -- [file]</code>命令把误删的文件恢复到最新版本。</li><li>如果用的<code>$git rm [file]</code>删除文件，相当于把工作区删除了，删除之后还提交到了暂存区；此时需要先<code>$git reset HEAD [file]</code>把暂存区回滚到上一个暂存区，然后再<code>$git checkout -- [file]</code>把工作区的修改撤销。 <img src="'+E+'" alt="1563785696463"></li><li>但是，只能恢复文件到最新版本，会丢失最近一次提交后你修改的内容。</li></ul></li></ul><p><strong>注意</strong>：从来没有被添加到版本库就被删除的文件，是无法恢复的。</p><h2 id="团队协作开发的基础流程" tabindex="-1"><a class="header-anchor" href="#团队协作开发的基础流程" aria-hidden="true">#</a> 团队协作开发的基础流程</h2><h3 id="基础流程操作" tabindex="-1"><a class="header-anchor" href="#基础流程操作" aria-hidden="true">#</a> 基础流程操作</h3><p><img src="'+C+'" alt="1563585356493"></p><ol><li><p>首先创建中央仓库：可以基于gitHub/codding来创建（<strong>最好不要创建空仓库，因为空仓库中没有任何分支，只有提交一次历史信息才会生成master分支</strong>） 把开发者都列入仓库的开发群组中，这样每一个开发者用自己的gitHub账号，都有权限操作这个仓库了（当然不这样做也可以，所有开发者用统一的一个账号也可以，为了防止不知道是谁提交的，我们需要让每一个客户端在本地的git全局配置中，设置和gitHub相同的用户名和邮箱<code>git config --global user.name &#39;xxx&#39;</code>） <img src="'+I+'" alt="1563575930059"> 会收到一封邮件，接受邀请</p></li><li><p>创建客户端本地仓库（一个开发者就是一个单独仓库），还需要让本地的仓库和远程仓库保持关联，这样才可以实现后续的信息同步</p><ul><li><p>一般的方式 <code>$git init</code>创建本地仓库 <code>$git remote add [远程地址名(默认origin)] [远程仓库git地址]</code>让本地仓库和远程仓库保持连接 <code>$git remote -v</code>查看连接（origin是连接的名称，一般都用这个名字，当然自己可以随便设置）</p><p><img src="'+Q+'" alt="1563884390124"></p><p>显示了可以抓取和推送的origin的地址。如果没有推送权限，就看不到push的地址。 <code>$git remote rm origin</code>移出本地仓库和远程仓库的链接 <code>$git remote update origin</code>更新链接通道 <img src="'+_+'" alt="1563577915957"> 增加了一个名为aaa的远程仓库 <img src="'+H+'" alt="1563578098463"></p></li><li><p>更简单的方式：只要把远程仓库克隆到本地，就相当于创建本地仓库，并且自动建立了链接，并且把远程仓库中的内容也同步到了本地</p><p><code>$git clone [远程仓库地址] [本地仓库文件夹名字]（不写默认是仓库名字）</code> 这一步操作相当于上面的三步：创建文件夹之后<code>$git init</code>；<code>$git remote add [远程地址名(默认origin)] [远程仓库git地址]</code>；<code>$git pull [git地址名] master</code></p><p><img src="'+B+'" alt="1563580891081"></p></li></ul></li><li><p>各自和中央服务器同步信息</p><p><strong>任何一个中央仓库在刚创建时是没有分支的，第一次pull是拉取不了的，第一次push才会创建msater分支</strong>：</p><p><code>$git push -u origin master</code>：由于远程库是空的，我们第一次推送master分支时，加上了<code>-u</code>参数，git不但会把本地的master分支内容推送到远程新的master分支，还会把本地的master分支和远程的master分支关联起来，在以后的推送或者拉取时就可以简化命令。 <code>$git push origin master</code>：把本地仓库master中的信息同步到远程仓库master中，<strong>需要使用gitHub的用户密码来进行权限校验</strong>：一般都是组长在远程仓库中把 组员的账号都放到一个小组中 ，这样组员用自己的账号也有权限操作仓库了，最好在本地的git配置中把用户名和邮箱修改为和gitHub账号相同的信息 （每一次PUSH之前最好都pull一下：如果有冲突在本地处理一下冲突，然后再推送。） <code>$git pull origin master</code>：把远程仓库master中的信息同步到本地仓库master中 使用<strong>空</strong>中央仓库，A push之后，B pull不下来的原因是A提交了自己的master分支，中央仓库中的master是A的，B指定origin master时，中央仓库中的master是A的，并不是中央仓库的</p><p><img src="'+R+'" alt="1563585430865"> 下面不是空中央仓库的流程：</p><p><img src="'+y+'" alt="1563584514880"><img src="'+G+'" alt="1563584711271"></p></li></ol><h2 id="分支处理和团队协作" tabindex="-1"><a class="header-anchor" href="#分支处理和团队协作" aria-hidden="true">#</a> 分支处理和团队协作</h2><h3 id="无分支管理模式" tabindex="-1"><a class="header-anchor" href="#无分支管理模式" aria-hidden="true">#</a> 无分支管理模式</h3><p>所有人使用的都是master分支，每次提交代码的时候，第一件事情就是先拉取。</p><p><code>$git pull origin master</code></p><p>冲突合并：</p><ul><li><p>文件有冲突，不是同一个文件</p></li><li><p>同一个文件，不是同一行代码冲突：在进入到编辑框模式中 i-&gt;ESC-&gt;:wq-&gt;按下enter键</p><p>自己会把两份代码都保存在本地文件中 ，自己手动去选择要哪一个，改完后重新提交即可</p></li><li><p>同一个文件，同一行代码冲突：如图所示，尝试合并失败，我们需要手动把代码进行合并，然后重新提交 <img src="'+k+'" alt="1563691729243"></p></li></ul><h3 id="单独分支管理模式" tabindex="-1"><a class="header-anchor" href="#单独分支管理模式" aria-hidden="true">#</a> 单独分支管理模式</h3><p>分支指的是历史区的分支：创建分支就是创建不同的线路，来管理历史版本</p><p><img src="'+D+'" alt="1563684239949"></p><ol><li><p>开发第一件事是把远程仓库master内容拉取到本地仓库master上（提交之前也是），每个人在自己本地仓库中，先进行分支创建和切换 <code>$git branch</code>：查看当前存在的分支</p><p><code>* master</code>：星代表当前在哪个分支上 <code>$git branch dev</code>：创建一个叫做dev的分支（<strong>新创建分支完成，会把本地的master分支中的内容同步到本地dev分支上</strong>） <code>$git checkout dev</code>：切换到dev分支上 <code>$git checkout -b dev</code>：创建并且切换到这个分支上</p></li><li><p>正常的开发和提交，但是所有的操作都是在自己的分支上</p></li><li><p>是否需要“储藏”文件 <code>$git stash</code>“储藏”文件（分支有更改，不能直接切换分支，需要把修改的内容暂存）<strong>情景</strong>：下班了这个模块还没完成，不想提交生成一个历史版本，因为commit之后才可以切换分支，所以需要把修改的内容暂存起来，才可以切换分支</p><p><code>$git stash list</code>：可以查看“储藏”列表 有两种方法恢复：</p><ul><li><code>$git stash apply</code>：恢复后，stash列表内容不删除，需要用<code>$git stash drop</code>删除 可以多次stash，恢复的时候，<code>$git stash apply stash@{0}</code>可以恢复指定的stash。</li><li><code>$git stash pop</code>：恢复的同时把stash内容也删除了</li></ul><p><code>$git checkout master</code>先切换到master分支上</p></li><li><p>把自己本地分支中的内容，合并到自己本地master分支上</p><p>如果dev和master分支分别对同一个文件做了修改，master分支和dev分支各自都有了新的提交，变成了这样 <img src="'+$+'" alt="img"> 这种情况下，Git无法执行“快速合并”，只能把各自的修改合并起来。</p><p><code>$git merge dev</code>把dev分支合并到master分支上（有冲突按照之前的规则修改） <img src="'+K+`" alt="1563836194206"> 冲突合并后：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>111111
222222
444
333
&lt;&lt;&lt;&lt;&lt;&lt;&lt; HEAD
555
=======
666
&gt;&gt;&gt;&gt;&gt;&gt;&gt; dev
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>修改好之后再次<code>$git add</code> <code>$git commit</code>，此时就变成了这样：</p><p><img src="`+N+'" alt="img"><code>$git log --graph</code>可以看到分支合并图 <img src="'+P+'" alt="1563836930039"></p></li><li><p>是否需要还原“储藏”文件 <code>$git stash pop</code>：还原暂时存储的内容，同时把stash list内容也删除了<img src="'+F+'" alt="1563702103067"></p></li><li><p>删除本地创建的分支（貌似不用删除dev分支提交到远程仓库，远程仓库中也不会出现dev分支）</p><ul><li>下一次重新创建分支的时候可以让分支和master统一，因为合并解决冲突之后，master分支是最新解决冲突合并之后的，而dev分支并没有解决冲突，已经没有保留dev分支的必要了。</li><li>远程仓库中不记录任何的分支信息，防止冲突 <code>$git branch -D dev</code>删除dev分支（删除的时候需要先切换到其他分支才可以删除）</li></ul></li><li><p>将本地master分支中的内容提交到远程仓库中</p></li></ol><h3 id="多人协作" tabindex="-1"><a class="header-anchor" href="#多人协作" aria-hidden="true">#</a> 多人协作</h3><p>当从远程仓库克隆时，实际上Git自动把本地的master分支和远程的master分支对应起来了，并且，远程仓库的默认名称是<code>origin</code></p><h2 id="github的应用" tabindex="-1"><a class="header-anchor" href="#github的应用" aria-hidden="true">#</a> gitHub的应用</h2><ul><li>常规操作：注册、登录、修改信息、创建仓库等</li><li>查看历史提交记录</li><li>提交问题</li><li>发送pull push</li><li>基于gitHub发布静态资源网站 <ul><li>基于master分支发布</li><li>基于gh-pages分支发布</li></ul></li><li>GUI：配置WB的VCS</li></ul><h2 id="ssh警告" tabindex="-1"><a class="header-anchor" href="#ssh警告" aria-hidden="true">#</a> SSH警告</h2><p>ssh比https速度快，前提是需要在GitHub的个人设置<code>SSH and GPG keys</code>或者指定一个仓库的<code>Deploy keys</code>绑定本地电脑的SSH key，才可以使用ssh方式与GitHub传输。</p><p>GitHub账户的<code>SSH keys</code>，相当于这个账号最高级 key，只要这个账号有的权限（任何项目），都可以操作 。</p><p>仓库的<code>Deploy keys</code>，是这个仓库专有的key，用这个key，只能操作这个项目，其他项目都没有权限。</p><p>https url是有效网址可以直接打开，但是用户每次通过git提交的时候都需要输入用户名和密码。</p><p>ssh url配置一次之后就能永久使用。GitHub配置ssh key的目的是为了git提交代码的时候，不需要繁琐的验证过程，简化操作步骤。</p><p>当第一次使用Git的<code>clone</code>或者<code>push</code>命令连接GitHub时，会得到一个警告：</p><p><img src="'+S+`" alt="1563891878689"></p><p>这是因为Git使用SSH连接，而SSH连接在第一次验证GitHub服务器的Key时，需要你确认GitHub的Key的指纹信息是否真的来自GitHub的服务器，输入<code>yes</code>回车即可。</p><p>Git会输出一个警告，告诉你已经把GitHub的Key添加到本机的一个信任列表里了：</p><p>这个警告只会出现一次，后面的操作就不会有任何警告了。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>Warning: Permanently added &#39;github.com&#39; (RSA) to the list of known hosts.
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p><img src="`+U+'" alt="1563892813240"></p><p>再次克隆提示需要把<code>id_rsa.pub</code>文件中的key粘贴到新建一个Keys的Key中，title随便起。</p><p><img src="'+z+'" alt="1563892791687"></p><p><img src="'+L+'" alt="1563893664907"></p><p>需要新建一个keys</p><p><img src="'+w+'" alt="1563892659893"></p><p>如果id_rsa、id_rsa.pub两个文件已存在出现该错误可删除俩个文件，重新执行</p><p><code>ssh-keygen -t rsa -C &quot;993445491@qq.com&quot;</code>：.shh文件夹会重新生成id_rsa、id_rsa.pub两个文件及新的Key</p><p>重新执行上述步骤添加到GitHub中即可</p>',79),T=i("code",null,"yes",-1),Y={href:"https://help.github.com/articles/what-are-github-s-ssh-key-fingerprints/",target:"_blank",rel:"noopener noreferrer"},W=t(`<h2 id="换源报错" tabindex="-1"><a class="header-anchor" href="#换源报错" aria-hidden="true">#</a> 换源报错</h2><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>ssh: Could not resolve hostname github.com: Name or service not known.fatal: Could not read from remote repository.
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>配置完公钥后想要进行远端github上clone出现错误；或者本地仓库换ssh源，进行拉取操作出现错误。</p><p>这是因为配置git时要验证是否成功。</p><p>输入：<code>ssh -T git@github.com</code></p><p>如果第一次会提示是否continue，输入yes会出现</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>You’ve successfully authenticated, but GitHub does not provide shell access 。这就表示已成功连上github。
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p><img src="`+V+'" alt="1566879129657"></p><h2 id="合并分支实例" tabindex="-1"><a class="header-anchor" href="#合并分支实例" aria-hidden="true">#</a> 合并分支实例</h2><p>master放整个项目所有功能最新的代码</p><p>index-swiper分支存放具体功能开发完成时的代码</p><p>企业中开发一个新功能测试没问题之后创建新的分支上传该功能的代码，再合并到整个项目中</p><ul><li>创建新的分支</li><li><code>git pull</code></li><li><code>git checkout [index-swiper]</code>切换到index-swiper分支</li><li><code>git add .</code>和<code>git commit -m &#39;&#39;</code>和<code>git push</code>之后</li><li><code>git checkout master</code>切换到主分支master</li><li><code>git merge origin/index-swiper</code>把线上index-swiper分支上新增的内容合并到本地的master分支</li><li><code>git push</code>把master新增的内容也提交到线上</li></ul>',13);function j(M,q){const s=o("ExternalLinkIcon");return a(),c("div",null,[X,i("p",null,[e("如果实在担心有人冒充GitHub服务器，输入"),T,e("前可以对照"),i("a",Y,[e("GitHub的RSA Key的指纹信息"),l(s)]),e("是否与SSH连接给出的一致。")]),W])}const J=d(O,[["render",j],["__file","index.html.vue"]]);export{J as default};
